import React, { Component } from 'react';
import mountains from '../../images/moutains.jpeg';

class Marquee extends Component {
  constructor(props){
    super(props);
    this.state={};
  }

  render() {
    return (
      <img src={moutains}/>
    );
  }
}

export default Marquee;
